webpackJsonp([0x5ff56096ab27],{346:function(e,t){e.exports={data:{markdownRemark:{html:'<p><img src="/static/Strood.jpg"></p>\n<p>Strood! Street food!  </p>\n<p><strong>About:</strong><br>\nThe Google Web Toolkit app that locates street food vendors around Vancouver.\nStreet food trucks are always moving around and it can be a hassle to find their location.\nWith Strood, users can find their closest street food vendor by sharing their location or locate the location of their favourite vendor.\nThey can choose to create an account and save their favourite vendors.\nAnd if they really enjoyed their experience, they can share it on social media (Twitter).  </p>\n<p><strong>Link:</strong><br>\nThe Github repository is a private, but the project was deployed to Google AppSpot and can be found at: <a href="http://1-dot-strood123.appspot.com/">Strood Website</a> (no longer supported).</p>\n<p><strong>Team:</strong><br>\nWe called our team "The Fantastic Four" and it likewise consisted of 4 people.\nIndividual tasks were organized and assigned during weekly scrum meetings.\nThe project was complete in November 2014 and lasted around 3 weeks.</p>\n<p><strong>Work:</strong><br>\nThe project was written using Java, HTML, CSS, and Google Web Toolkit (GWT).\nAnd a parser was developed to read the datasets from <a href="https://data.gov.bc.ca/">DataBC</a>.\nI worked on the functionality and logic of various website features.\nThis mainly consisted of the rating system, favourite system, and the object structures.</p>',frontmatter:{date:"November 01, 2018",path:"/Strood",title:"Strood",image:"/static/Strood.jpg"}}},pathContext:{}}}});
